import React from "react";

import "./Post.css";

const post = (props) => (
  <article className="Post" onClick={props.clicked}>
    <h1>{props.Project_Name}</h1>
    <div className="Info">
      <div className="Author">{props.Project_Supervisor}</div>
    </div>
  </article>
);

export default post;
